COSBase cosNumber = acquireItem( j );
if (cosNumber instanceof COSInteger)
{
    COSInteger cosInt = (COSInteger)cosNumber;
    result[j] = cosInt.intValue();
}
else if (cosNumber instanceof COSFloat)
{
    COSFloat cosFloat = (COSFloat)cosNumber;
    result[j] = cosFloat.floatValue();
}

